import React from "react";
import { Link } from "react-router-dom";

function Important() {
  return (
    <div>
      <h1>Welcome to Important List</h1>
      <Button component={Link} to={"/"}>
        Go back to Home
      </Button>
    </div>
  );
}

export default Important;
